// import React from 'react';
import { Link } from 'react-router-dom';
import '../Style/Start.css'; // Import CSS file if needed

const FullPageImage = () => {
  return (
    <div className="full-page-container">
      <div className="top-text-container">
        <h1>Welcome to JOBNEST</h1>
        <p className="moving-text">WHERE DREAM MEETS CARRERS</p>
      </div>
      <div className="logo-container"> {/* Center the logo */}
        <img src="data:image/jpg;base64," alt="Job Nest Logo" className="logo" />
      </div>

      <img src="https://png.pngtree.com/background/20210709/original/pngtree-blue-postgraduate-theme-background-picture-image_958535.jpg" alt="Full Page Background" className="full-page-image" />

      <div className="buttons-container"> {/* Container for buttons */}
        <Link to="/Login"><button className="button">Admin Login</button></Link>
        <Link to="/Login"><button className="button">User Login</button></Link>
      </div>
    </div>
  );
};

export default FullPageImage;
